// Style base for filtering emojis
function emojistyle(key) {
    let style = "#spotlight-emojis spotmoji x.emoji:not(." + key + ") {display: none;}";
    return style;
}

// Function for printing the Emojiboard
let print;
function echo(key) {
    if (!print) {
        print = key;
    } else {
        print = print + key;
    }
}

// Function for Pushing Filter Keys
function setKey(input, num, keyclass) {
    echo(`<key `);
    if (keyclass) {
        echo(`class="${keyclass}" `);
    }
    //echo(`type="${input.key}" `);
    echo(`onclick="filterKey('${input.key}',${num})">`);
    echo(`<span>${input.mob}</span><span>${input.name}</span>`);
    echo(`</key>`);
}

// Function for Pushing Emojis
function setEmoji(input) {
    for (let x = 0; x < input.emojis.length; x++) {
        echo(`<x class="emoji ${input.key}" `);
        echo(`title="${input.emojis[x].alt}">`);
        echo(input.emojis[x].obj);
        echo(`</x>`);
    }
}

// Print the Emojiboard
echo(`<spotfilter>`);
setKey(smileys, 0, "active");
setKey(nature, 1);
setKey(food, 2);
setKey(activity, 3);
setKey(places, 4);
setKey(objects, 5);
setKey(symbols, 6);
setKey(flags, 7);
echo(`</spotfilter>`);
echo(`<spotmoji>`);
setEmoji(smileys);
setEmoji(nature);
setEmoji(food);
setEmoji(activity);
setEmoji(places);
setEmoji(objects);
setEmoji(symbols);
setEmoji(flags);
echo(`</spotmoji>`);

// Function for adding spotlight styles
function addStyle(css, id) {
    let head, style;
    head = document.getElementsByTagName("head")[0];
    if (!head) {window.location.reload();}
    style = document.createElement("style");
    if (id) {style.id = id;}
    style.setAttribute("type", "text/css");
    style.innerHTML = css;
    head.appendChild(style);
}

// Function for adding spotlight scripts
function addScript(js) {
    let body, script;
    body = document.getElementsByTagName("body")[0];
    if (!body) {window.location.reload();}
    script = document.createElement("script");
    script.setAttribute("type", "text/javascript");
    script.innerHTML = js;
    body.appendChild(script);
}

// Function for making JS changes
function spotlightJS(key, link, icon) {
    let spotHead = document.querySelector(".shoutbox-container .content-title.toggle");
    spotHead.removeAttribute("onclick");

    if (key.match(/enter/i)) {
        spotHead.children[0].setAttribute("onclick","toggleShoutbox()");
        spotHead.children[1].setAttribute("onclick","toggleShoutbox()");
    } else {
        spotHead.children[1].remove();
        spotHead.classList.remove("toggle");
    }

    // Create flex container for content title buttons
    let newCon = document.createElement("div");
    newCon.id = "spotbtns";
    spotHead.appendChild(newCon);

    // Grab newCon by id for further manipulation
    newCon = document.getElementById("spotbtns");

    // Button for entering and exiting spotlight mode
    let anchor = document.createElement("a");
    anchor.id = "spotlight";
    anchor.title = key + " Spotlight";
    anchor.href = link;
    anchor.innerHTML = `<i class="material-icons">${icon}</i>`;
    newCon.appendChild(anchor);

    // Chat direction button
    let span = document.createElement("span");
    span.id = "chatdirection";
    if (localStorage.shoutpath === "bottom") {span.classList.add("bottom");}
    span.title = "Switch Chat Direction";
    span.setAttribute("onclick","chatSwitch()");
    span.innerHTML = `<i class="material-icons">switch_left</i>`;
    newCon.appendChild(span);

    // This portion works if we're already in spotlight mode
    if (key.match(/exit/i)) {
        anchor = document.createElement("a");
        anchor.id = "greasylight";
        anchor.title = "View on Greasy Fork";
        anchor.href = "https://greasyfork.org/en/scripts/455154";
        anchor.target = "_blank";
        anchor.innerHTML = `<span class="material-icons">bug_report</span>`;
        newCon.appendChild(anchor);

        anchor = document.createElement("a");
        anchor.id = "forumlight";
        anchor.title = "View Support Thread";
        anchor.href = location.origin + "/forums.php?action=viewtopic&topicid=42627";
        anchor.target = "_blank";
        anchor.innerHTML = `<span class="material-icons">info_outline</span>`;
        newCon.appendChild(anchor);

        span = document.createElement("span");
        span.id = "chatsounds";
        if (localStorage.soundstate === "off") {span.classList.add("off");}
        span.title = "Toggle Chat Sounds";
        span.setAttribute("onclick","chatSounds()");
        span.innerHTML = `<i class="material-icons">volume_up</i><i class="material-icons">volume_off</i>`;
        newCon.appendChild(span);
    }
}

// Function for adding new Emoji toggle button
function emojiboardJS() {
    let face = document.createElement("span"),
        ibbc = document.getElementById("shout-ibb-container"),
        befr = document.getElementById("shoutHistoryBtn");
    face.classList.add("inline-submit-btn");
    face.title = "Unicode Emojis";
    face.setAttribute("onclick","toggleEmojis()");
    face.innerHTML = "<i class='material-icons'>face</i>";
    ibbc.insertBefore(face,befr);
}

// Removing whitespace from Shout Ibb Container
function whiteNull() {
    let ibbcon = document.getElementById("shout-ibb-container");
    ibbcon.innerHTML = ibbcon.innerHTML.replace(/>\s+</g,'><');
}

// Producing the base for new emojis
function emojiJS(key) {
    let container = document.getElementById("shout-send-container"),
        bottom = document.getElementById("shout_text"),
        div = document.createElement("div");
    div.id = "spotlight-emojis";
    div.classList.add("fader");
    div.innerHTML = key;
    container.insertBefore(div, bottom);
}

// New Emojis on the homepage
function emojihomeJS(key) {
    let emojis = document.getElementById("spotlight-emojis");
    emojis.innerHTML = key;

    let emojiOrigin = document.querySelector("#shout-ibb-container span[onclick='toggleSmilies()']");
    emojiOrigin.outerHTML = `
      <span class="inline-submit-btn" onclick="toggleSmilemoji('smileys','emojis')" title="Smilies &amp; Stickers"><i class="material-icons">mood</i></span>
      <span class="inline-submit-btn" onclick="toggleSmilemoji('emojis','smileys')" title="Unicode Emojis"><i class="material-icons">face</i></span>
    `.replace(/>\s+</g,'><');
}

// Putting native smileys in a different container
function smileyJS() {
    let container = document.getElementById("shout-send-container"),
        bottom = document.getElementById("shout_text"),
        div = document.createElement("div"),
        old = document.getElementById("smilies-outline"),
        toggle = document.querySelector("#shout-ibb-container span[onclick*='toggleSmilies']");
    div.innerHTML = old.innerHTML;
    old.remove();
    div.id = "spotlight-smileys";
    div.classList.add("fader");
    container.insertBefore(div, bottom);

    toggle.setAttribute("onclick","toggleSmileys()");
}

// Update shoutpath visibility based on localstorage value
function shoutPathUpdate() {
    let shoutpathCSS = document.getElementById("shoutpath");
    if (!localStorage.shoutpath || localStorage.shoutpath !== "bottom") {
        shoutpathCSS.setAttribute("type","null");
    } else {
        shoutpathCSS.setAttribute("type","text/css");
    }
}

// Add and remove audio
function toneDeaf(source) {
    if (localStorage.soundstate === "off") {return;}

    let audio = document.createElement("audio");
    audio.classList.add('curtain');
    audio.innerHTML = `<source src="${source}" type="audio/mpeg">`;

    document.body.appendChild(audio);
    audio.play();

    setTimeout(function() {
        audio.remove();
    }, 1000);
}

